import React from 'react'
import { useAuth } from '../Context/AuthContext'
import { useNavigate } from 'react-router-dom';

const Navbar = () => {
    const navigate = useNavigate()
    const {logout, isloggedin} = useAuth();
  return (
    <nav class="containernavbar navbar-dark bg-dark">
        <div className='container'></div>
    <a class="navbar-brand container" href="#">Navbar</a>
    {isloggedin ?  <button type="button" onClick={()=>{logout()}} class="btn btn-outline-dark m-2">Log Out</button>: <button type="button" onClick={(e) => {navigate("/login")}} class="btn btn-outline-dark m-2">Log in</button>}
    </nav>
  )
}

export default Navbar
